import styled from 'styled-components/native'
import { FlatList } from 'react-native'


export const Title = styled.Text`
    background-color: #C4170C;
    width: 100%;
    font-weight: bold;
    text-align: center;
    margin-top: 10px;
    padding: 10px;
    font-size: 20px;
    color: #fff;
    line-height: 21px;
`;

export const Container = styled.div`
    flex: 1;
    margin-top: 15px;
   
    div {
        background-color: '#f9c2ff';
        padding: 20;
        margin: 8px 16px;
    }

    label: {
        fontSize: 32;
    }

`
